termsFooter_howItWorks_text:
Dra och släpp filer i det avsedda området eller välj dem på traditionellt sätt; filerna krypteras och skickas till servern. Du kommer att få två länkar till filen:
En nedladdningslänk, som du kan dela med andra;
och en borttagningslänk, där du kan ta bort filen när som helst.
